import { BrowserRouter, Switch, Route } from "react-router-dom";
import HomePage from "./pages/HomePage";
import DeviceList from "./DeviceList";

function App() {
  return (
    <BrowserRouter>
      <Switch>
        <Route exact path="/" component={HomePage} />
        <Route path="/devices" component={DeviceList} />
      </Switch>
    </BrowserRouter>
  );
}

export default App;
